import "./colFooter.css";

const ColFooter = (props) => {
  const arr = props.col_number[0];
  console.log(arr);
  return (
    <div
      className={`item-${props.index} text-primary footer__item`}
      style={{ margin: 0 }}
    >
      {arr.map((el, index) => {
        return <p key={index}>{el}</p>;
      })}
    </div>
  );
};

export default ColFooter;
